import React from 'react'





class Login extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            username: '',
            password: ''
        }
    }



    render () {
        return (
            <div>
                <input for='login'>Please Login</input>
                <input type='text' placeholder='Username'></input>
                <input type='text' placeholder='password'></input>
            </div>
        )
    }


}

export default Login
